import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

import Cover from "./components/Cover/index";

let showCover;

ReactDOM.render(
  <React.StrictMode>
    <Cover show={showCover}>
      <div className="box">我是插槽</div>
    </Cover>
  </React.StrictMode>,

  document.getElementById("root")
);
